import React from 'react';
import './styles.css';
import Navbar from './components/Navbar';
import { Routes, Route } from 'react-router-dom';

function App() {
  return (
    <div >
        <Routes>
          <Route element={<Chat />}/>
        </Routes>
        <Navbar />
    </div>
  );
}

export default App;
